        DISCLAIMER_CONTENT: '\n      <h2>Toronto\'s Vision Zero Road Safety Map\n    </h2>\n    <p>The Toronto\'s Vision Zero Map is an interactive tool that displays information on historical collisions (fatalities and seriously injured) and safety measures that have been implemented under the City of Torontos Vision Zero program. The map was built to provide a transparent view into the historical locations of collisions in the city side by side with the suite of safety measures that are being deployed through the Vision Zero program.</p>\n    <h3 class="header">New Features Include</h3>\n    <ul>\n      <li>Interactive dashboards</li>\n      <li>Additional safety measure data including: curb radii reductions, right turn channel removals, automated bike detection, increased pedestrian crossing times, community safety zones, bike boxes and bike intersection crossings </li>\n      <li>Open data releases </li>\n      <li>Supporting contextual data layers (e.g. school locations, senior facility locations etc.)</li>\n      <li>Upgraded features and enhancements based on user feedback</li>\n    </ul>\n    <h3 class="header">Send us your Feedback</h3>\n    <p>Were looking for ways to improve our map and would love to hear from you. Tell us about your experience, what you like, what you dont like, what is missing or what is confusing and let us know about any bugs youve found. Email us at <a href="mailto:VisionZeroTO@toronto.ca?subject=Vision Zero Map Feedback" title="Send your feedback by email to Vision Zero Toronto team">VisionZeroTO@toronto.ca</a>, we look forward to hearing your feedback.</p>\n  ',
